import styled from "styled-components";

function ProductCard({ onNavigate, product }) {
  return (
    <>
      {product.map((a, i) => {
        return (
          <S.Item onClick={onNavigate}>
            <h4>구멍난 양말</h4>
            <p>상품번호: 302012</p>
            <p>가격: 3000원</p>
            <p>사이즈: X, M, L</p>
            <p>평점: 4.5</p>
            <p>리뷰: 14</p>
          </S.Item>
        );
      })}
    </>
  );
}
export default ProductCard;

const Item = styled.li`
  border: 1px solid #000;
  cursor: pointer;
  width: 300px;
  margin: 16px auto;
`;

